import React from 'react'
import "../styles/polling.css";
import Result from './Result';
import 'react-circular-progressbar/dist/styles.css';
import { useState ,useEffect} from 'react';
import { CircularProgressbar ,buildStyles} from 'react-circular-progressbar';
import { ToastContainer,toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

export const Polling = () => {
  const [a,seta]=useState(20);
  const [b,setb]=useState(30);
  const [c,setc]=useState(40);
  const [d,setd]=useState(10);
  const notify = () => {
    toast("Hello, this is a toast message!");
  };
    const customStyles = buildStyles({
        pathColor: 'black', // Adjust the color here
        textColor: 'white',
        trailColor: '#d6d6d6',
        backgroundColor: '#ffff',
      });
    const [val,setval]=useState([20,30,40,10]);
    const handle_click=(val)=>{
        if(val==0){
            seta(90);
        }
        else if(val==1){
            setval([20,40,20,10]);
        }
        else if(val==2){
            setval([20,20,40,10]);
        }
        else{
            setval([20,20,10,40]);
        }
    }
   
  return (
    <div class="polling" style={{width:1200}}>
        
            <header style={{fontSize:30}}>9th March,Saturday</header>
    <header style={{fontSize:20}}>Period 6</header>
    <br/>
    <div class="wrapper">
    <div class="poll-area">
      <input type="checkbox" name="poll" id="opt-1"/>
      <input type="checkbox" name="poll" id="opt-2"/>
      <input type="checkbox" name="poll" id="opt-3"/>
      <input type="checkbox" name="poll" id="opt-4"/>
      <label for="opt-1" class="opt-1">
        <div class="row">
          <div class="column">
          <br/><br/>
            <span class="circle"></span>
    
        <span class="text" onClick={()=>handle_click(0)}>   <pre>DesignThinking  </pre></span>
        <span class="">    <div style={{width:'50px'}}><CircularProgressbar  value={val[0]} text={`${val[0]}%`} styles={customStyles} /></div></span>
          </div>
        </div>
        <div class="progress" ></div>

      </label>
      
      <label for="opt-2" class="opt-2">
        <div class="row">
          <div class="column">
            <span class="circle"></span>
            <span class="text">   <pre>Java            </pre></span>
            <span class="">    <div style={{width:'50px'}}><CircularProgressbar  value={val[1]} text={`${val[1]}%`} styles={customStyles} /></div></span>
          </div>
          <span class="percent">20%</span>
        </div>
        <div class="progress" ></div>
      </label>
      <label for="opt-3" class="opt-3">
        <div class="row">
          <div class="column">
            <span class="circle"></span>
            <span class="text">   <pre>AIML            </pre></span>
            <span class="">    <div style={{width:'50px'}}><CircularProgressbar  value={val[2]} text={`${val[2]}%`} styles={customStyles} /></div></span>
          </div>
          <span class="percent">40%</span>
        </div>
        <div class="progress" ></div>
      </label>
      <label for="opt-4" class="opt-4">
        <div class="row">
          <div class="column">
            <span class="circle"></span>
            <span class="text">   <pre>Cloud Computing </pre></span>
            <span class="">    <div style={{width:'50px'}}><CircularProgressbar  value={val[3]} text={`${val[3]}%`} styles={customStyles} /></div></span>
          </div>
          <span class="percent">10%</span>
        </div>
        <div class="progress" ></div>
      </label>
    </div>
  </div></div>
  )
}
export default Polling;
